import React, { Component } from 'react';
import PropTypes from 'prop-types';


const Navbar = (props)=>{   

    return (
    <nav className="navbar bg-primary">
        <h1>
        <i className={this.props.icon}/>{this.props.title} 
        </h1>
    </nav>
    );
  }

Navbar.defaultProps={
    title:'Github Finder',
    icon:'fab fa-github'
};
export default Navbar;
